                    //         post: post,
                    //         author: post.author
                    //     });
                    //     const user = await User.findOne(post.author._id);

                    //     user.comments.push(comment);
                    //     post.comments.push(comment);

                    //     await user.save();
                    //     await post.save();
                    //     await comment.save();

                    //     resolve(comment);
                    // });
            });
        } catch (error) {
            console.log(error);
            throw error;
        }
    }
}

